import React from 'react';
import './Contacts.css';

function ContactList({ contacts, handleEdit, handleDelete }) {
  if (!contacts || contacts.length === 0) {
    return (
      <div className="empty-state">
        <div className="empty-icon">ðŸ“­</div>
        <h2 className="empty-title">No contacts found</h2>
        <p className="empty-description">Add some contacts to get started.</p>
      </div>
    );
  }

  return (
    <ul className="contacts-list">
      {contacts.map((contact) => (
        <li key={contact._id} className="contact-item">
          <div>
            <p className="contact-name">{contact.name}</p>
            <p className="contact-email">{contact.email}</p>
            <p className="contact-phone">{contact.phone}</p>
          </div>
          <div>
            <button onClick={() => handleEdit(contact)} className="logout-button" style={{ marginRight: '0.5rem' }}>
              Edit
            </button>
            <button onClick={() => handleDelete(contact._id)} className="logout-button">
              Delete
            </button>
          </div>
        </li>
      ))}
    </ul>
  );
}

export default ContactList;
